import React from 'react'
import './NavBar.scss'
var List=()=>{
	return(
		<>
			<ul>
				<li><a href="#">Features</a></li>
				<li><a href="#">Pricing</a></li>
				<li><a href="#">Resources</a></li>
			</ul>
			<ul>
				<li>Login</li>
				<li className="signIn"><button>Sign Up</button></li>
			</ul>
			</>
		)
}
export default function NavBarMobile({checked}) {
	return (
		<div style={{opacity:checked?'1':'0'}} className="NavBarMobile">
			<List/>
		</div>
	)
}

export function NavBarDesktop() {
	return (
		<div className="NavBarDesktop">
			<List/>
			fsdfd
		</div>
	)
}
